import React, { useState,useEffect } from 'react'
import axios from 'axios';
import './App.css'

const url = 'https://3b33-2402-800-6235-73aa-987f-bbbf-be44-2572.ngrok-free.app//'
const TableBooking = () => {
const [bookings,setBookings] = useState([])
const [room_meeting, setRoomMeeting] = useState([])
const [employees, setEmployees] = useState([])

useEffect(() => {
    axios.get(url +'/bookings',
            {
                withCredentials: true
            }
        ).then(res => {
            setBookings(res.data.bookings)})
}, []);
useEffect(() => {
    axios.get(url + '/employee',
    {
        withCredentials: true
    }
    ).then(res => {
        setEmployees(res.data.employee)})
})
useEffect(() => {
    axios.get(url + '/rooms',
    {
        withCredentials: true
    }
    ).then(res => {
        setRoomMeeting(res.data.room_meeting)})
})
  return (
    <div>
      <div className='container'>
        <table>
            <thead>
                <tr>
                    <th>STT</th>
                    <th>Room Name</th>
                    <th>Start Time</th>
                    <th>End Time</th>
                    <th>Employee</th>
                </tr>
            </thead>
            <tbody>
                {bookings.map((book, key )=>{
                    return(
                        <tr key={book.booking_id}>
                            <td>{book.booking_id}</td>
                            {/* <td>{book.room_id === room_meeting.room_id && room_meeting.room_name  }</td> */}
                            <td>{book.time_start_booking}</td>
                            <td>{book.time_end_booking}</td>
                            <td>{book.employees_id === employees.employees_id} && {employees.employees_name} </td>


                        </tr>
                    )
                })}


            </tbody>
        </table>
      </div>
    </div>
  )
}

export default TableBooking
